import EventList from '../components/EventsList';
export function EventPage(){

    const events = [
        {
            id: 'e1',
            image: 'foo.png',
            title: 'Event 1',
            date: '15-Feb-2024'
        },
        {
            id: 'e2',
            image: 'foo',
            title: 'Event 2',
            date: '14-Feb-2024'
        },
        {
            id: 'e3',
            image: 'foo',
            title: 'Event 3',
            date: '24-Jan-2024'
        },
        {
            id: 'e4',
            image: 'foo',
            title: 'Event 4',
            date: '31-Nov-2023'
        }
    ];
    return (
        <div>
            <h1>Welcome to the Event page.</h1>
            { <EventList events={events} /> }
        </div>
    );
}
